import React, {Component} from 'react';
import {Link} from 'react-router-dom';

import image from '../assets/img/slider/1.jpg'


import Header from '../Common/Header';
import NewProducts from '../Common/NewProducts';

class Home extends Component {
    render(){
        return(
			<div>
                <Header
                    image1={image}
                    title1="viet gi do"
                    subtitle1="okokokokookkokokokokokokokookokkookkokoko"
                    link1="/"
                    linktext1="nhan vao day"
                    title2="viet gi do"
                    subtitle2="okokokokookkokokokokokokokookokkookkokoko"
                    link2="/"
                    linktext2="nhan vao day"
                />
            </div>
        )
    }
}

export default Home;
